import { useDispatch, useSelector } from "react-redux";
import OneKey from "./OneKey";

const AllKeys = () => {
    var allkeys = useSelector(state => state.employees.allKeys)
    const employees = useSelector(state => state.employees.employees)
    allkeys.map(keyitem => {
        var empl = employees.find(employee => employee.emplid == keyitem.employeeid)
        if (empl) keyitem.concat(keyitem, empl)
    })
    const dispatch = useDispatch()
    return (
        <tbody>
            {allkeys.map(
                keyitem =>
                <OneKey key = {keyitem.keyid} keyitem = {keyitem}/>
            )}
        </tbody>
    );
};

export default AllKeys;
